import React from "react";
import { styles } from "./Header.module.scss";
export function Header() {
  return (
    <header className="page_header">
      <div className="content">
        <div className="header_left-navig">
          <img src="/public/vkLogo.svg" alt="logo" />
        </div>
      </div>
    </header>
  );
}
